import React from "react";


const Contact = () => {
    return (
        <div className="container">
            <div className="py-4">
                <h1>Get In Touch</h1>

                <div className="row mt-4">
                    <div className="col-6">
                    <p><b>Address For Noida Office : </b>101, Infinity Business Park, Plot H-221, Sector 63, Noida, Uttar Pradesh 201307 </p>
                    <p><b>Contact No:</b>084481 08985</p>
                    </div>


                    <div className="col-6">
                    <p><b>Address For Gurugram Office : </b>2nd Floor, 55 P, Sector 44, Gurugram, Haryana 122003 </p>
                    <p><b>Contact No:</b>070420 20782</p>
                    </div>
                </div>



            </div>
        </div>
    );
};



export default Contact;
